async function highlightCode(){let t=document.querySelectorAll("code"),e=Array.from(t).map(t=>{let e=t.getAttribute("lang"),i=t.textContent;return fetch("https://highlight.phpexperts.pro/highlight",{method:"POST",headers:{"Content-Type":"application/json","User-Agent":"insomnium/0.2.3-a"},body:JSON.stringify({lang:e,text:i})})}),i=await Promise.all(e),n=await Promise.all(i.map(t=>t.text()));t.forEach((t,e)=>{t.innerHTML=n[e]})}
highlightCode();
